import React, {Component} from 'react';
import AOS from 'aos';
import './App.css';
import 'aos/dist/aos.css';


class App extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    AOS.init({
      duration : 2000
    })
  }

  render() {
    return (
      <Title/>
    );
  }
}


class Title extends Component {
  render() {
    return (
      <div className="Title">
        <div className="TitleAnchor"/>
        <div className="TitleTextContainer">
          <h1 className="TitleText" data-aos="food" data-aos-anchor=".TitleAnchor" data-aos-anchor-placement="bottom-top">
            MAGDALEN BALL
          </h1>
        </div>
      </div>
    );
  }
}


export default App;
